"<div>\n<i class=\"NoteType\">\nL\u00e4hdeteksti\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://sukuhaku.genealogia.fi/#bookid=355&amp;page=7&amp;pageid=33240<br />\n\"... Suvun polveutumista on voitu seurata vanhimmassa maakirjassa mainittuun nimismies Olavi Tuurenpoikaan, joka esiintyy Kangasalan Raikun Siurolan is\u00e4nt\u00e4n\u00e4 vuoteen 1556. Suvun kantais\u00e4n\u00e4 voidaan mahdollisesti pit\u00e4\u00e4 v. 1412 Siurolan is\u00e4nt\u00e4n\u00e4 mainittua Lauri Raikkuista, mutta sukujohtoa ei voida asiakirjallisesti osoittaa....<br />\nTaulu 1.<br />\nI. Olavi Tuurenpoika. Kangasalan Raikun Siurolan talollinen v:een 1556. Nimismies.\n</p>\n<p>\nP o i k a:<br />\nII. Sipi Olavinpoika. Siurolan talollinen is\u00e4ns\u00e4 j\u00e4lkeen v:een 1599.\n</p>\n<p>\nP o i k a:<br />\nIII. Tuure Sipinpoika. Siurolan is\u00e4nt\u00e4 v:een 1613.\n</p>\n<p>\nP o i k a:<br />\nIV. Klemetti Tuurenpoika. Siurolan is\u00e4nt\u00e4 v:een 1639.\n</p>\n<p>\nP o i k a:<br />\nV. Tuure Klemetinpoika. Kangasalan Paalilan Lintulan ratsutilallinen 1650-1674. - Puoliso Liisa Simontyt\u00e4r.\n</p>\n<p>\nP o i k a:<br />\nVI. Simo Tuurenpoika, s. 1645. Lintulan ratsutilallinen. K. ennen 1711. Puoliso Maria Yrj\u00e4n\u00e4ntyt\u00e4r, s. 1656, k. 7.12.1740.\n</p>\n<p>\nP o i k a:<br />\nVII. Sipi Simonpoika, s. 1684. Kangasalan Heponiemen Huikkolan ratsutilallinen. K. Kangasalla 2.4.1745. - Puoliso Sohvi Matintyt\u00e4r, s. 1682, k. 3.7.1768.\n</p>\n<p>\nP o i k a:<br />\nVIII. Tuure Sipinpoika, s. 25.7.1718. K\u00f6yli\u00f6n Kankaanp\u00e4\u00e4n Otavalan ratsutilallinen, sitt. S\u00e4kyl\u00e4n Kirrin ratsutilallinen. K. K\u00f6yli\u00f6ss\u00e4 7.5.1808. - Puoliso Kangasalla 7.10.1739 Anna Matintyt\u00e4r Heponiemest\u00e4, s. 1715, k. K\u00f6yli\u00f6ss\u00e4 13.11.1783.\n</p>\n<p>\nP o i k a:<br />\nIX. Simon Helenius, s. Messukyl\u00e4ss\u00e4 27.5.1755. Yliopp. (satak.) 22.5.1776 Turun koulusta, jonne tuli 7.4.1771 nimell\u00e4 Elenius. Vih. papiksi 6.6.1781 ja m\u00e4\u00e4r\u00e4ttiin Yl\u00e4neen kirkkoherranapul:ksi. Sauvon pit\u00e4j\u00e4napulainen 1788. Myn\u00e4m\u00e4en kappalainen 1800. K. siell\u00e4 2.11.1815. - Puoliso Kristina Katarina Tallqvist, s. Laitilassa 11.4.1759, k. Myn\u00e4m\u00e4ell\u00e4 31.8. 1816, vht Laitilan komppanian majoittaja Karl Daniel Tallqvist ja Margareta Kristina Belin.\n</p>\n<p>\nX. L a p s i a (syntyneet Yl\u00e4neell\u00e4):<br />\nKarl, s. 18.12. 1784, kirkkoherra, teologian tohtori, k. 1855. Taulu 2.\n</p>\n<p>\nNils, s. 22.10.1787. Yliopp. (satak.) 20.6.1804. Vih.papiksi Turussa 19.12.1810 ja m\u00e4\u00e4r\u00e4ttiin H\u00e4meenlinnan kirkkoherranapulaiseksi. Porin koulun apologista 1812. K. Porissa 23.7. 1816.Naimaton.\"\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nL\u00e4hdeteksti\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://sukuhaku.genealogia.fi/#bookid=355&amp;page=7&amp;pageid=33240<br />\n\"Helenius... Suvun polveutumista on voitu seurata vanhimmassa maakirjassa mainittuun nimismies Olavi Tuurenpoikaan, joka esiintyy Kangasalan Raikun Siurolan is\u00e4nt\u00e4n\u00e4 vuoteen 1556. Suvun kantais\u00e4n\u00e4 voidaan mahdollisesti pit\u00e4\u00e4 v. 1412 Siurolan is\u00e4nt\u00e4n\u00e4 mainittua Lauri Raikkuista, mutta sukujohtoa ei voida asiakirjallisesti osoittaa...<br />\nTaulu 1.<br />\nI. Olavi Tuurenpoika. Kangasalan Raikun Siurolan talollinen v:een 1556. Nimismies.<br />\nP o i k a:<br />\nII. Sipi Olavinpoika. Siurolan talollinen is\u00e4ns\u00e4 j\u00e4lkeen v:een 1599.<br />\nP o i k a:<br />\nIII. Tuure Sipinpoika. Siurolan is\u00e4nt\u00e4 v:een 1613.<br />\nP o i k a:<br />\nIV. Klemetti Tuurenpoika. Siurolan is\u00e4nt\u00e4 v:een 1639.<br />\nP o i k a:<br />\nV. Tuure Klemetinpoika. Kangasalan Paalilan Lintulan ratsutilallinen 1650-1674. - Puoliso Liisa Simontyt\u00e4r.<br />\n...\"\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
